import React, { useState, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';



const Register = () => {
    const navigate = useNavigate();
    const [data, setData] = useState({ name: '', phone: '', password: '' });
    const [responseMsg, setResponseMsg] = useState('');

    const onchangeHandler = (e) => {
        const { name, value } = e.target;
        setData({ ...data, [name]: value });
    };

    const registerUser = async () => {
        try {
            if (!data.name || !data.phone || !data.password) {
                setResponseMsg('تمام فیلدها الزامی است');
                return;
            }
            const response = await axios.post('http://localhost:8080/api/register', data, {
                withCredentials: true,
            });

            if (response.status === 201) {
                navigate(response.data.redirect);
            }
        } catch (error) {
            if (error.response) {
                const { status } = error.response;
                const message = error.response.data.message;

                if (status === 400) {
                    setResponseMsg(message || 'تمام فیلدها الزامی است.');
                } else if (status === 409) {
                    setResponseMsg(message || 'نام کاربری یا شماره قبلاً ثبت شده است.');
                } else if (status === 500) {
                    setResponseMsg(message || 'خطای داخلی سرور. لطفاً بعداً دوباره تلاش کنید.');
                } else {
                    setResponseMsg(message || 'خطای غیرمنتظره رخ داد.');
                }
            } else {
                setResponseMsg('خطای شبکه. لطفاً اتصال خود را بررسی کنید.');
            }
        }
    };

    useEffect(() => {
        const checkSession = async () => {
            try {
                const response = await axios.get('http://localhost:8080/api/check-session', {
                    withCredentials: true,
                });
                if (response.data.loggedIn && response.data.redirect) {
                    navigate(response.data.redirect);
                }
            } catch (error) {
                console.log(error);
            }
        };
        checkSession();
    }, [navigate]);

    const handleKeyPress = (e) => {
        if (e.key === 'Enter') {
            registerUser();
        }
    };

    return (
        <Wrapper onKeyPress={handleKeyPress}>
            <Left>
                <Circle className="circle1" />
                <Circle className="circle2" />
                <Circle className="circle3" />
                <Circle className="circle4" />
                <Welcome>! به فروشگاه ما خوش آمدید</Welcome>
                <Description>
                    لطفاً برای ادامه ثبت‌نام کنید. این یک فروشگاه آنلاین است که می‌توانید شکلات‌های سفارشی و همچنین بسته‌هایی برای هر مناسبت بخرید.
                </Description>
                <LinkText>
                    قبلاً حساب دارید؟ <StyledLink to="/login">ورود</StyledLink>
                </LinkText>
            </Left>
            <Right>
                <Container>
                    <Heading>ثبت نام</Heading>
                    <Input name="name" value={data.name} onChange={onchangeHandler} placeholder="نام" />
                    <Input name="phone" value={data.phone} onChange={onchangeHandler} placeholder="شماره تلفن" />
                    <Input type="password" name="password" value={data.password} onChange={onchangeHandler} placeholder="رمز عبور" />
                    <RegisterButton onClick={registerUser}>ثبت‌نام</RegisterButton>
                    {responseMsg && <ResponseMsg>{responseMsg}</ResponseMsg>}
                </Container>
            </Right>
        </Wrapper>
    );
};

export default Register;
